import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import WorkerDashboard from "./components/WorkerDashboard";
import LocalManagerDashboard from "./components/LocalManagerDashboard";
import RegionalManagerDashboard from "./components/RegionalManagerDashboard";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <nav>
            <ul style={{ listStyle: "none", display: "flex", gap: "1rem" }}>
              <li><Link to="/worker">Worker View</Link></li>
              <li><Link to="/local-manager">Local Manager View</Link></li>
              <li><Link to="/regional-manager">Regional Manager View</Link></li>
            </ul>
          </nav>
        </header>
        <Routes>
          <Route path="/worker" element={<WorkerDashboard />} />
          <Route path="/local-manager" element={<LocalManagerDashboard />} />
          <Route path="/regional-manager" element={<RegionalManagerDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
